	@Inject
	public MoCDslGrammarAccess(GrammarProvider grammarProvider,
		CCSLLibraryGrammarAccess gaCCSLLibrary) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaCCSLLibrary = gaCCSLLibrary;
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("org.gemoc.mocc.cometaccsl.model.xtext.MoCDsl".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	
	public Grammar getGrammar() {
		return grammar;
	}
	

	public CCSLLibraryGrammarAccess getCCSLLibraryGrammarAccess() {
		return gaCCSLLibrary;
	}

	
